import React, { Component } from 'react';

class Serachbar extends Component {
  state = {
    searchQuery: ""
  }
  formSubmit=(event)=>{
      // event.preventDefault();

  }
  render() {
    return <form onSubmit={this.formSubmit}>
      <div className='form-row mb-5'>
        <div className='col-12'>
          <br>
          </br>
          <input onChange={(event) => this.setState({ searchQuery: event.target.value })} type="text" className='input-group' placeholder='Search movie' value={this.state.searchQuery}></input>
        </div>
      </div>;
    </form>
  }
}
export default Serachbar;
